import React from "react";
import HeroSection from "./components/HeroSection";
import Wiget from "./components/Wiget";
import Container from "@material-ui/core/Container";

function App() {
  return (
    <div className='app'>
      <Wiget />

      <Container>
        <HeroSection />
        <br/>
      </Container>
    </div>
  );
}

export default App;
